" <div id=\"topicContent\">",
"  <div id=\"topicTitle\">",
"   Long-term complications of pelvic inflammatory disease",
"  </div>",
"  <div id=\"topicContributors\">",
"   <div>",
"    <a id=\"authors\">",
"    </a>",
