var title_f0_58_940="Treatment recommend ovar GCT";
var content_f0_58_940=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ONC%2F55704&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ONC%2F55704&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Summary of recommendations for treatment of ovarian germ cell tumors",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Tumor type",
"       </td>",
"       <td class=\"subtitle1\">",
"        Recommended treatment",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\" rowspan=\"1\">",
"        Dysgerminoma",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Stage I",
"       </td>",
"       <td>",
"        Surgery",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Stage IB or IC",
"       </td>",
"       <td>",
"        Surgery plus three cycles of BEP or CE",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Stage II to III",
"       </td>",
"       <td>",
"        Surgery plus four cycles of BEP or CE",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Stage IV",
"       </td>",
"       <td>",
"        Surgery plus four cycles of BEP",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\" rowspan=\"1\">",
"        Immature teratoma",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Stage I unruptured, grade 1",
"       </td>",
"       <td>",
"        Surgery",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Stage I ruptured or grade 2 or 3",
"       </td>",
"       <td>",
"        Surgery plus three cycles of BEP",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\" rowspan=\"1\">",
"        All other histologies",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Stage I",
"       </td>",
"       <td>",
"        Surgery plus three cycles of BEP*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Stage II to III, completely resected",
"       </td>",
"       <td>",
"        Surgery plus four cycles of BEP",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Gross residual or stage IV",
"       </td>",
"       <td>",
"        Surgery plus six cycles of BEP",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     BEP: bleomycin, etoposide, cisplatin; CE: carboplatin etoposide.",
"     <br>",
"      * Whether carboplatin can be substituted for cisplatin unclear; most prefer cisplatin.",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
