var title_f0_58_942="Effect of globin charge on hemoglobin assembly";
var content_f0_58_942=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=HEME%2F72950&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=HEME%2F72950&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 516px\">",
"   <div class=\"ttl\">",
"    Effect of charge of the mutant &beta;-globin chain on in vitro assembly of the abnormal hemoglobin",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 496px; height: 525px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    In these in vitro experiments, equal amounts of normal and mutant beta chains were incubated with limiting quantities of normal alpha chains. The fraction of total hemoglobin represented by the abnormal hemoglobin is plotted here versus the net charge of the mutant beta chain. Separate experiments for 72 stable beta globin variants are each represented by a single open circle. The normal beta chain, which has a net charge of -2.5 at pH 7.2, is shown as the red circle at the 50 percent point. Under the same conditions, the normal alpha chain has a net charge of +2.4.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from Bunn, HF. Blood 1987; 69:1.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
